import React, { useState } from 'react';

export const Historique = () => {

    const [items, setItems] = useState();


  useEffect(() => {
    fetch('http://172.16.1.105:8080/Historique/1',{ method: "GET" }).then((response)=>response.json()).then((json)=>setItems(json.data));
  },[]);

  return (
    <>
    <h2>Historique du client</h2>
    <table border="1">
        <tr>
            <th>ID</th>
            <th>IdProduit</th>
            <th>IdClient</th>
            <th>Montant Enchere</th>
            <th>Produit</th>
            <th>Duree</th>
            <th>Date enchere</th>
            <th>Prix min</th>
            <th>Client</th>
            <th>Email</th>
        </tr>
        {items.map((item) => {
            return (
                <tr>
                    <td>{item.id}</td>
                    <td>{item.idproduit}</td>
                    <td>{item.idclient}</td>
                    <td>{item.montantenchere}</td>
                    <td>{item.produit}</td>
                    <td>{item.duree}</td>
                    <td>{item.dateenchere}</td>
                    <td>{item.prixmin}</td>
                    <td>{item.client}</td>
                    <td>{item.email}</td>
                </tr>
            )
        })}
    </table>
    </>
  );
}

export default Historique;
